INSERT INTO `hitokoto` VALUES (1,'決裁管理 はいつから使えるんですか？','決裁管理 はいつから使えるんですか？<br />\r\n<br />\r\n<br />\r\n＝＝＝＝＝＝＝お答え＝＝＝＝＝＝＝＝＝＝<br />\r\nもうすぐできます。','2010-12-12 00:28:59',1,'管理者'),(2,'複数名が同一日程時の記載方法教えてください','複数の人が同じスケジュールを入力する場合、一つのイベントに対して人を追加する方法があればご教示ください。表示上、スケジュールが重複して見難いと思います。イベント情報が第一で、誰が参加するかは第二の重要事項と思います。<br />\r\n<br />\r\n====================お答え=====================<br />\r\nご意見有難うございます。<br />\r\n今のシステムは、一つのイベントに対して人を追加する機能はありません。<br />\r\nイベントに参加する本人が直接に入力するようになっておりますが、<br />\r\nご意見参考して見難くならないように改善します。','2010-12-16 09:00:44',1,'森山');
