INSERT INTO `info_item` VALUES (1,2,1,2,'膝関節の構造は大腿骨、硬骨、鼻骨 など','<p><font size=\"2\">「構造」　</font></p>\r\n<div style=\"text-indent: 9pt\"><font size=\"2\">　大腿骨（Femur）</font></div>\r\n<div style=\"text-indent: 19pt\"><font size=\"2\">硬骨（Tibia）</font></div>\r\n<div style=\"text-indent: 19pt\"><font size=\"2\">鼻骨 （Fibula）</font></div>\r\n<div style=\"text-indent: 19pt\"><font size=\"2\">膝蓋骨（Patella）</font></div>\r\n<div style=\"text-indent: 19pt\"><font size=\"2\">大腿科（Femoral　condyle）</font></div>\r\n<div style=\"text-indent: 19pt\"><font size=\"2\">骨膜（Periosteum）</font></div>\r\n<div style=\"text-indent: 19pt\"><font size=\"2\">軟骨下骨（Subchondral　bone）</font></div>\r\n<div style=\"text-indent: 19pt\"><font size=\"2\">軟骨 （Cartilage）</font></div>\r\n<div style=\"text-indent: 19pt\"><font size=\"2\">硝子軟骨 （Hyaline cartilage）</font></div>\r\n<div style=\"text-indent: 19pt\"><font size=\"2\">纎維軟骨 （Fibrocartilage）</font></div>\r\n<div style=\"text-indent: 19pt\"><font size=\"2\">軟骨細胞 （Chondrocyte）...</font></div>','2010-03-21 03:33:10',1,1);
/*!40000 ALTER TABLE `info_item` ENABLE KEYS */;
