INSERT INTO `job_item` VALUES (1,2,1,2,'勤務及び福利厚生制度','<p><font color=\"#333333\">*基本人事制度<br />\r\n<br />\r\n</font></p>\r\n<p class=\"marktext\"><font color=\"#333333\">人事制度の基本ともいえる仕事の評価と処遇のシステムは成果主義の思想のもとに構築され、(1)明確な目標設定、(2)目標達成度に対する厳密・明確かつオープンな評価、(3)高い成果に対する厚い処遇、を特徴としています。</font></p>\r\n<p><br />\r\n<font color=\"#333333\">&nbsp;</font></p>\r\n<br />\r\n<br />','2010-10-18 03:28:49',1,1);
