INSERT INTO `product` VALUES (2,'2-2-201003038870',2,'2010-03-03 08:42:34','2-2-201003038870','NovoFill ノボフィル','オリジナル　アテロコラーゲン濃縮液\r\nノボフィルは肌のハリ不足へ集中的にケアして欠損された皮膚組織に健康を与え、再生できるように導きます。\r\n','<p><font size=\"2\">「製品特徴」<br />\r\n</font><font size=\"2\"><br />\r\nノボフィルは肌のハリ不足へ集中的にケアして欠損された皮膚組織に健康を与え、再生できるように導きます。</font></p>',1),(3,'1-3-201003032665',2,'2010-03-03 09:31:24','1-3-201003032665','Regeneration Gel リゼネレーション','呼吸する保護膜を形成して肌をしっとりと保つコラーゲンゲル','<p><font size=\"2\">お肌の欠損しやすい昼や細胞活動が<br />\r\n活発な夜にノボストラタはあなたの健康な美しさのためにかかせない必須プログラムです。<br />\r\n<br />\r\n</font><font size=\"2\">-高純度アテロコラーゲンは呼吸する保護・保湿膜を形成し、乾燥で肌荒れを２４時間防いで、<br />\r\nお肌本来の働きを整えるように自然治癒力をアップする環境を調整してイキイキした透明なお肌に導きます。</font></p>',1),(4,'2-4-201003037053',2,'2010-03-03 09:46:20','2-4-201003037053','BioCollagen Intensive Skin Care Program','呼吸する保護膜を形成して肌をしっとりと保つコラーゲンゲル\r\n','<p><font size=\"2\">お肌の欠損しやすい昼や細胞活動が活発な夜に<br />\r\nノボストラタはあなたの健康な美しさのためにかかせない必須プログラムです。</font></p>\r\n<div><font size=\"2\">-高純度アテロコラーゲンは呼吸する保護・保湿膜を形成し、乾燥で肌荒れを２４時間防いで、<br />\r\nお肌本来の働きを整えるように自然治癒力をアップする環境を調整してイキイキした透明なお肌に導きます。</font></div>',1),(5,'2-5-201003037923',2,'2010-03-03 09:51:55','2-5-201003037923','リゼネレーション トナー (Regeneration Toner)','ノボフィルは肌のハリ不足へ集中的にケアして欠損された皮膚組織に健康を与え、\r\n再生できるように導きます。','<p><font size=\"2\">お肌の欠損しやすい昼や細胞活動が活発な夜に<br />\r\nノボストラタはあなたの健康な美しさのためにかかせない必須プログラムです。</font></p>\r\n<div><font size=\"2\">-高純度アテロコラーゲンは呼吸する保護・保湿膜を形成し、乾燥で肌荒れを２４時間防いで、<br />\r\nお肌本来の働きを整えるように自然治癒力をアップする環境を調整してイキイキした透明なお肌に導きます。</font></div>',1),(6,'1-6-201003112643',1,'2010-03-12 00:18:47','1-6-201010195121','自家軟骨細胞とは？','自家組織由来の軟骨細胞培養物である自家軟骨細胞は余り使わない患者の元気な軟骨組織を体外に取り出し、軟\r\n骨組織から軟骨細胞を分離して増殖培養させた後、軟骨欠損治療に使われる細胞培養製品です。','<div><font size=\"2\">（１）概要及び使い方</font></div>\r\n<div><span style=\"color: black; font-size: 9.5pt\">自家組織由</span><span style=\"color: black; font-size: 9.5pt\">来</span><span style=\"color: black; font-size: 9.5pt\">の</span><font size=\"2\">軟骨細胞培養物である自家軟骨細胞は余り使わない患者の元気な軟骨組織を体外に取り出し、<br />\r\n軟骨組織から軟骨細胞を分離して増殖培養させた後、軟骨欠損治療に使われる細胞培養製品です。<br />\r\n<br />\r\n<div><font size=\"2\">自家軟骨細胞は手術的に患者の軟骨欠損部位を骨膜にて縫合した後、注入されます。<br />\r\n一本(vial)の自家軟骨細胞には</font><span style=\"color: black; font-size: 9.5pt\">自家組織由</span><span style=\"color: black; font-size: 9.5pt\">来</span><span style=\"color: black; font-size: 9.5pt\">で</span><font size=\"2\">培養された軟骨細胞が 0.4ml、<br />\r\nおよそ12、000、000個が入っており、細胞の生存率は 80%以上です。<br />\r\n<br />\r\n<div><font size=\"2\">自家軟骨細胞の手術ができる軟骨欠損がある場合、関節鏡手術を通じて軟骨損傷を確認し、<br />\r\n元気で体重が積まれない部位の軟骨を少量採取します。(軟骨採取による痛症や副作用はありません)<br />\r\n<br />\r\n<div><font size=\"2\">取り出した軟骨はセワンセロンテック(株)に運送され、約4週間培養期間を持つようになり、約4週間後、<br />\r\n細胞培養が終わって自家軟骨細胞が完成されれば自家軟骨細胞移植の手術が行われます。<br />\r\n<br />\r\n<div><font color=\"#3399ff\" size=\"2\"><strong>手術過程<br />\r\n</strong>\r\n<div><font color=\"#000000\" size=\"2\">膝関節を切開して病便のある部位の軟骨をきれいに整理した後、移植される自家軟骨細胞を支える<br />\r\n骨膜を移植するようになります。</font></div>\r\n<div><font color=\"#000000\" size=\"+0\">&nbsp;</font></div>\r\n<div><font color=\"#000000\" size=\"2\">移植される部位に骨膜を覆って自家軟骨細胞が漏れないようによく縫合した後、縫合された骨膜の下を通じて<br />\r\n自家軟骨細胞を注射します。 自家軟骨細胞移植が終わったら切開した肌組職を縫合します。<br />\r\n<br />\r\n<div><font size=\"2\">（２）内容物<br />\r\n<table style=\"width: 420px; height: 126px\" border=\"1\" cellspacing=\"1\" cellpadding=\"1\" width=\"420\">\r\n    <tbody>\r\n        <tr>\r\n            <td>\r\n            <div><font size=\"2\">自家軟骨細胞１バイアル（vial）の中</font></div>\r\n            <div style=\"text-indent: 9pt\"><font size=\"2\">*主成分：自家培養軟骨細胞</font></div>\r\n            <div style=\"text-indent: 9pt\"><font size=\"2\">*軟骨細胞培養液</font></div>\r\n            </td>\r\n            <td>\r\n            <div><font size=\"2\">約1200万個</font></div>\r\n            <span style=\"font-size: 10pt\">0.4ml</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td>\r\n            <div><font size=\"2\">培地１バイアルの中</font></div>\r\n            <span style=\"font-size: 10pt\">　</span><span style=\"font-size: 10pt\">*</span><span style=\"font-size: 10pt\">軟骨細胞培養液</span></td>\r\n            <td><span style=\"font-family: &quot;MS Mincho&quot;; font-size: 10pt; mso-fareast-language: JA; mso-bidi-font-family: &rsquo;Times New Roman&rsquo;; mso-bidi-font-size: 11.0pt; mso-bidi-theme-font: minor-bidi; mso-ansi-language: EN-US; mso-bidi-language: AR-SA\" lang=\"EN-US\">0.5ml</span></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</font></div>\r\n<br />\r\n</font></div>\r\n<div><font size=\"+0\">&nbsp;</font></div>\r\n</font></div>\r\n</font></div>\r\n</font></div>\r\n</font></div>\r\n</font></div>',1),(7,'1-7-201003129126',1,'2010-03-12 00:26:19','1-7-201010193115','自家軟骨細胞の開発背景及び研究過程','“自分の細胞や組織で自分の疾患を治療する生命工学時代の夢、、、その夢はセワンセロンテックによって現実\r\nにつながります”','<p><font size=\"2\"><font color=\"#3366ff\">&ldquo;自分の細胞や組織で自分の疾患を治療する生命工学時代の夢、、、<br />\r\nその夢はセワンセロンテックによって現実につながります&rdquo;</font><br />\r\n<br />\r\n<font size=\"2\">膝関節（しつかんせつ）の不安定性や半月上軟骨の部分的な欠損は関節面の摩耗と損傷を促進させるという<br />\r\n事実は多くの研究によって立証されました。また、一度損傷された関節軟骨は生体内で正常に再生せず、<br />\r\n損傷された関節軟骨に対する晩成的な刺激は関節痛と関節運動の漸進的な制限のみではなく<br />\r\n結局には退行性関節炎をもたらすようになります。</font></font></p>\r\n<div>&nbsp;</div>\r\n<div><font size=\"2\">このような臨床症状は、個人の日常的な生活や職業活動などに悪影響を及ぼすことがあります。&nbsp;<br />\r\n正常成人の関節軟骨細胞は生体内で細胞増殖ができず、生体外で培養条件を適切に合わせる場合、<br />\r\n軟骨細胞の分化と増殖を誘導することができます。したがって、培養された軟骨細胞は欠損された関節面を<br />\r\n再生させるのに非常に効率的に使われることができ、骨軟骨組職の移植とは異なって移植された軟骨細胞は<br />\r\n宿主骨との境界である軟骨下骨板の上で正常的な関節軟骨に再生されます。</font></div>',1),(8,'1-8-201003173446',1,'2010-03-17 01:47:56','1-8-201010191229','自家軟骨細胞長所','最も早くて効果的な再生力、高い安全性や有効性そして再生された軟骨の永久性！！','<div><font color=\"#339966\" size=\"2\">最も早くて効果的な再生力、高い安全性や有効性そして再生された軟骨の永久性！！</font></div>\r\n<div>&nbsp;</div>\r\n<div><font size=\"2\">関節軟骨損傷がある患者で他の治療方法で治療することができない広範囲病便の場合</font></div>\r\n<div><font size=\"2\">軟骨損傷を治療することができる唯一の方法で早くて效果的な再生力, 高い安全性と有效性そして再生された軟骨の永久性などの長所があります.</font></div>\r\n<div>&nbsp;</div>\r\n<div><font size=\"2\">「自家組織由来軟骨細胞の移植術_Autologous Chondrocyte Transplantation 」</font></div>\r\n<div><font size=\"2\">*硝子軟骨形成</font></div>\r\n<div><font size=\"2\">*再生された軟骨の永久性</font></div>\r\n<div><font size=\"2\">*一番效果的な治療法</font></div>\r\n<div>&nbsp;</div>\r\n<div><font size=\"2\">「関節成型術_Abrasion Arthroplasty 」</font></div>\r\n<div><font size=\"2\">*手術後一年内に再発(纎維軟骨増殖)</font></div>\r\n<div>&nbsp;</div>\r\n<div><font size=\"2\">「</font><span style=\"color: black; font-size: 9pt\">穿孔術</span><span style=\"color: black; font-size: 9pt\">及び</span><font size=\"2\">微細骨折術_Drlling and Microfracture 」</font></div>\r\n<div><font size=\"2\">*不適切な治癒反応</font></div>\r\n<div><font size=\"2\">*限られた寿命(約 1年)</font></div>\r\n<div><font size=\"2\">*手術後関節損傷の再発が早い</font></div>\r\n<div>&nbsp;</div>\r\n<div><font size=\"2\">「軟骨膜移植術_Perichondrium Resurfacing」</font></div>\r\n<div><font size=\"2\">*軟骨膜で覆いにくい大きい病便のひんぱんな出現</font></div>\r\n<div><font size=\"2\">*長期間追跡観察の時移植の方に軟骨内骨化現象</font></div>\r\n<div>&nbsp;</div>\r\n<div><font size=\"2\">「合成物_Synthetic materials」</font></div>\r\n<div><font size=\"2\">*纎維組職の頻繁な生成</font></div>\r\n<div><font size=\"2\">*生力学的不適切性</font></div>\r\n<div><font size=\"2\">*滑液膜炎の発生可能性</font></div>\r\n<div>&nbsp;</div>\r\n<div><font size=\"2\">「骨軟骨組織移植術_Osteocartilageinous Grarfts」</font></div>\r\n<div><font size=\"2\">*新鮮な軟骨が移植されない場合、 頻繁な組職怪死発生</font></div>\r\n<div><font size=\"2\">*新鮮な組職確保の難しさ及び疾病転化の危険性</font></div>\r\n<div><font size=\"2\">*冷凍保存組職(cryopreserved graft)の場合、長期保存ができるが結局には変敗される。</font></div>',1),(9,'1-9-201003173101',1,'2010-03-17 01:49:27','1-9-201010203344','適応症、手術料、保険料','自家軟骨細胞の適応症、手術料、保険料の情報をお知らせます。','<p><font size=\"2\">１）適応症（自家軟骨細胞移植の可能な疾患）<br />\r\n</font><font size=\"2\">　　膝関節の部分的軟骨欠損(単独病変：15㎠ 以下、多発病変：20㎠ 以下)</font></p>',1),(10,'1-10-201003174620',1,'2010-03-17 01:51:22','1-10-201010207328','効能、効果','自家軟骨細胞のみの効能や効果の情報をお知らせます。','<p><font size=\"2\">自家軟骨細胞を用いた自家組織由来軟骨細胞移植術は移植の後、<br />\r\n正常的の生物学的成状を持った軟骨を再生することができます。<br />\r\n<br />\r\n<font color=\"#993399\" size=\"2\"><span style=\"color: #7030a0\">&ldquo;自家軟骨細胞は自分の体に最も理想的なものです。&rdquo;<br />\r\n</span></font><font color=\"#9999ff\" size=\"2\"><span style=\"color: #7030a0\">&ldquo;自家軟骨細胞は自分の体に最も革新的なものです。&rdquo;<br />\r\n</span></font><font size=\"2\">生物学的の軟骨再生で手術後6～12週になると正常的に歩くことができ、16ヶ月後には自転車などのように<br />\r\nきつい運動も可能なので革新的な治療剤として一発に永久的の治療効果を得ることができます。</font></font></p>',1),(11,'1-11-201003172517',1,'2010-03-17 01:54:27','1-11-201010201069','用法、容量','自家軟骨細胞に入る用法や容量についてお知らせます。','<p><font size=\"2\">バイアルに充填された細胞を十分に懸濁させた後、<br />\r\n欠損部分に移植するが量を十分に注入するように</font><font size=\"2\">します。</font></p>',1),(12,'1-12-201003207691',1,'2010-03-20 02:24:50','1-12-201003201842','副作用及びタブー事項','同製品を用いて自家組織由来の軟骨細胞移植手術中或いは手術の後に、次のような合併症（余病）に会うことが\r\nありますので適切な措置が要ります。','<p><font size=\"2\">（１）副作用</font></p>\r\n<div style=\"text-indent: 9.75pt\"><font size=\"2\">１．同製品を用いて自家組織由来の軟骨細胞移植手術中或いは手術の後に、次のような</font><span style=\"color: black; font-size: 9.5pt\">合併症（余病）に<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 会うことがありますので適切な措置が要ります。<br />\r\n</span></div>\r\n<div style=\"text-indent: 9.75pt\"><font size=\"2\"><span style=\"color: black\">&nbsp;&nbsp;&nbsp;&nbsp; * </span>関節内癒着（intra-articular adhesion)、表層手術部位感染<span>(superficial wound infection)</span>、&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 肥大活膜炎(hypertrophic synovitis)、手術後血腫<span>(post-operative hematoma)</span>、膝蓋上活膜の<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 癒着<span>(adhesions of the bursa suprapatellaris)</span>、活膜肥大(hypertrophic synovium)の副作用が<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 現われる恐れがあります。</font></div>\r\n<div style=\"text-indent: 9.75pt\">&nbsp;</div>\r\n<div style=\"text-indent: 9.75pt\"><font size=\"2\">&nbsp;&nbsp;&nbsp;&nbsp; * また、その以外に珍しく凍結膝関節(frozen knee)と溶解を起こす深刻な副作用が現われろこともあります。</font></div>\r\n<div style=\"text-indent: 9.75pt\">&nbsp;</div>\r\n<div style=\"text-indent: 9.75pt\"><font size=\"2\">&nbsp;&nbsp;&nbsp;&nbsp; * ケロイド傷跡、 パンヌス形成、 関節の腫脹、手術後発熱が現われるかもしれません。</font></div>\r\n<div style=\"text-indent: 9.75pt\">&nbsp;</div>\r\n<div style=\"text-indent: 9.75pt\"><font size=\"2\">２．手術後軟骨細胞の移植した多くの患者に組織過増殖 (Tissue Hypertrophy)によって異常音またはcatching<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; などの臨床的症侯が現われることがあり、このような場合東組職の節制で好転することができます。</font></div>\r\n<div style=\"text-indent: 9.75pt\">&nbsp;</div>\r\n<div style=\"text-indent: 9.75pt\"><font size=\"2\">３．市販後使用成績の調査にて手術後下腿部水泡、肌のかゆみ、痛症、反対側の足の疼痛やむくみ、<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 関節面一部の再露出、関節内異常音(click sound)などの有害事例が発生したが同製品との<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 因果関係は立証されなかったです。<br />\r\n<br />\r\n</font><font size=\"2\">（２）タブー事項</font></div>\r\n<div style=\"text-indent: 9.75pt\"><font size=\"2\">　１．牛たん白質に敏感な患者</font></div>\r\n<div style=\"text-indent: 9.75pt\"><font size=\"2\">　２．ゲンタマイシン（Gengamicin）抗生剤に敏感な患者</font></div>\r\n<div style=\"text-indent: 9.75pt\"><font size=\"2\">　３．<span style=\"color: black\">リウマトイド</span><span style=\"color: black\">関節炎、通風性関節炎など炎症性関節炎の患者</span></font></div>\r\n<div style=\"text-indent: 9.75pt\"><span style=\"color: black\"><font size=\"2\">　４．自家免疫疾患に係っている関節炎の患者</font></span></div>',1),(13,'1-13-201003201760',1,'2010-03-20 02:26:31','1-13-201010195577','自家軟骨細胞手術法','自家組織由来軟骨細胞移植術','<p>&nbsp;</p>\r\n<div style=\"text-indent: 9.75pt\"><font size=\"2\"><span style=\"color: black\">１）自家組織由来軟骨細胞移植術.</span></font></div>\r\n<div style=\"text-indent: 9.75pt\">&nbsp;</div>\r\n<div style=\"text-indent: 9.75pt\"><font style=\"background-color: #ccffcc\" size=\"2\">（軟骨組織を取り出す）―＞（細胞培養＿４週）―＞（自家軟骨細胞移植術）―＞（移植終了）</font></div>',1);
/*!40000 ALTER TABLE `product` ENABLE KEYS */;
UNLOCK TABLES;

--
-- Table structure for table `purchase_order`
--

DROP TABLE IF EXISTS `purchase_order`;
SET @saved_cs_client     = @@character_set_client;
SET character_set_client = utf8;
CREATE TABLE `purchase_order` (
  `seq` int(11) NOT NULL,
  `mseq` int(11) default NULL,
  `register` datetime default NULL,
  `contact_order` varchar(100) default NULL,
  `sign_01` int(11) default NULL,
  `sign_02` int(11) default NULL,
  `sign_03` int(11) default NULL,
  `sign_01_yn` int(11) default '1',
  `sign_02_yn` int(11) default '1',
  `sign_03_yn` int(11) default '1',
  `kind_urgency` int(11) default '1',
  `comment` varchar(200) default NULL,
  `hizuke` char(10) default NULL,
  `title` varchar(200) default NULL,
  `del_yn` int(11) default '1',
